import './App.css';
import './bulma/css/bulma.min.css';
import NavBar from './components/NavBar';
//import btn_primary from './components/CustomBtn';
import Hero_JM from './components/Hero';

const App = () => {
    return (
      <div className="App">
        <header>
          <div NavBar={NavBar}></div>
        </header>
        <body>
          <div Hero_JM={Hero_JM}></div>
          <div>
            <p>
              Edit <code>src/App.js</code> and save to reload.
            </p>
          </div>
        </body>
        <footer></footer>
      </div>   
    )
}

export default App;


